import React from 'react';
import styled from 'styled-components';

const SHome = styled.div`
  height: 100%;
`;

const TopBanner = styled.div`
  width: 98%;
  height: 30%;
`;
const LeftTopBanner = styled.div`
  width: 70%;
  float: left;
`;
const RightTopBanner = styled.div`
  display: inline-block;
  width: 29%;
  height: 30%;
`;

const Home = () => {
  return (
    <SHome>
      <TopBanner>
        <LeftTopBanner>
          <div>Banner1</div>
          <div>Banner2</div>
          <div>Banner3</div>
        </LeftTopBanner>
        <RightTopBanner>
          <img src="https://placeimg.com/350/400/any" />
        </RightTopBanner>
      </TopBanner>
    </SHome>
  );
};

Home.getInitialProps = async context => {
  return true;
};

export default Home;
